import React, { useState } from "react";

const Contact = () => {
    const [data, setData] = useState({
        fullname:"",
        phone:"",
        email:"",
        msg:""
    });

    const InputEvent = (event) =>{
        const [name, value] = event.target;

        setData((prev)=>{
            return {
                ...prev,
                [name]:value,
            }
        })

    }
    return(
        <>
              <div className="my-5" >
                <h1 className="text-center" >Our Services</h1>
              </div>
              <div className=" container contact_div">
                  <div className="row">
                      <div  className="col-md-6 col-10 mx-auto">
                        <form>
                            <div class="mb-3">
                            <label for="exampleFormControlInput1" class="form-label">Name</label>
                            <input type="text" class="form-control" id="exampleFormControlInput1" value={data.fullname} name="fullname" onChange={InputEvent} placeholder="Enter your name" />
                            </div>
                            <div class="mb-3">
                            <label for="exampleFormControlInput1" class="form-label">Phone Number</label>s
                            <input type="number" class="form-control" id="exampleFormControlInput1" value={data.phone} name="phone" onChange={InputEvent} placeholder="Enter phone number" />
                            </div>
                            <div class="mb-3">
                            <label for="exampleFormControlInput1" class="form-label">Email address</label>
                            <input type="email" class="form-control" id="exampleFormControlInput1" value={data.email} name="email" onChange={InputEvent} placeholder="name@example.com" />
                            </div>
                            <div class="mb-3">
                            <label for="exampleFormControlTextarea1" class="form-label">Massage</label>
                            <textarea class="form-control" id="exampleFormControlTextarea1" value={data.msg} name="msg" onChange={InputEvent}  rows="3"></textarea>
                            </div>
                            <div class="col-12">
                                <button class="btn btn-outline-primary" type="submit">Submit form</button>
                            </div>
                        </form>

                      </div>
                  </div>
              </div>
        </>
    )
}


export default Contact;
